import React from 'react'
import style from '../styles/footer.css'

const Footer = () => {
  return (
    <div>
        <link rel="stylesheet" href={style} />
        <footer>
            <p>Coffee Boom</p>
        </footer>
    </div>
  )
}

export default Footer
